s"}],"name":"compile9","outputs":[{"internalType":"string","name":"","type":"string"}],"stateMutability":"view","type":"function"},{"inputs":[],"name":"fflate","outputs":[{"internalType":"string","name":"","type":"string"}],"stateMutability":"view","type":"function"},{"inputs":[],"name":"owner","outputs":[{"internalType":"address","name":"","type":"address"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"address","name":"chunk1","type":"address"},{"internalType":"address","name":"chunk2","type":"address"}],"name":"setFFlateAddress","outputs":[],"stateMutability":"nonpayable","type":"function"}],"devdoc":{"kind":"dev","methods":{},"version":1},"userdoc":{"kind":"user","methods":{},"version":1}},"settings":{"compilationTarget":{"contracts/DataChunkCompiler.sol":"DataChunkCompiler"},"evmVersion":"paris","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":true,"runs":200},"remappings":[]},"sources":{"contracts/DataChunkCompiler.sol":{"content":"// SPDX-License-Identifier: Unlicense
// by dom; use however you like

pragma solidity ^0.8.24;

interface IDataChunk {
    function data() external view returns (string memory);
}

interface IDataChunkCompiler {
    function BEGIN_JSON() external view returns (string memory);

    function END_JSON() external view returns (string memory);

    function HTML_HEAD() external view returns (string memory);

    function BEGIN_SCRIPT() external view returns (string memory);

    function END_SCRIPT() external view returns (string memory);

    function BEGIN_SCRIPT_DATA() external view returns (string memory);

    function END_SCRIPT_DATA() external view returns (string memory);

    function BEGIN_SCRIPT_DATA_COMPRESSED() external view returns (string memory);

    function END_SCRIPT_DATA_COMPRESSED() external view returns (string memory);

    function SCRIPT_VAR(
        string memory name,
        string memory value,
        bool omitQuotes
    ) external pure returns (string memory);

    function BEGIN_METADATA_VAR(string memory name, bool omitQuotes) external pure returns (string memory);

    function END_METADATA_VAR(bool omitQuotes) external pure returns (string memory);

    function compile2(address chunk1, address chunk2) external view returns (string memory);

    function compile3(
        address chunk1,
        address chunk2,
        address chunk3
    ) external returns (string memory);

    function compile4(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4
    ) external view returns (string memory);

    function compile5(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5
    ) external view returns (string memory);

    function compile6(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5,
        address chunk6
    ) external view returns (string memory);

    function compile7(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5,
        address chunk6,
        address chunk7
    ) external view returns (string memory);

    function compile8(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5,
        address chunk6,
        address chunk7,
        address chunk8
    ) external view returns (string memory);

    function compile9(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5,
        address chunk6,
        address chunk7,
        address chunk8,
        address chunk9
    ) external view returns (string memory);
}

contract DataChunkCompiler {
    address public immutable owner;

    // via https://gist.github.com/enepomnyaschih/72c423f727d395eeaa09697058238727 (MIT License)
    string public constant base64Utils =
        "data%253Atext%252Fjavascript%253Bbase64%%%252BIDQpXTsKICAgIHJlc3VsdCArPSBiYXNlNjRhYmNbKChieXRlc1tpIC0gMV0gJiAweDBGKSA8PCAyKSB8IChieXRlc1tpXSA%%252BIDJdOwogICAgcmVzdWx0ICs9IGJhc2U2NGFiY1soKGJ5dGVzW2kgLSAyXSAmIDB4MDMpIDw8IDQpIHwgKGJ5dGVzW2kgLSAxXSA%%252FIDIgOiBzdHIuZW5kc1dpdGgoIj0iKSA%%252BPiA4KSAmIDB4RkY7CiAgICByZXN1bHRbaiArIDJdID0gYnVmZmVyICYgMHhGRjsKICB9CiAgcmV0dXJuIHJlc3VsdC5zdWJhcnJheSgwLCByZXN1bHQubGVuZ3RoIC0gbWlzc2luZ09jdGV0cyk7Cn0%253D";

    string public constant BEGIN_JSON = "data:application/json,%7B"; // data:application/json,{
    string public constant END_JSON = "%7D"; // }
    string public constant BEGIN_SCRIPT = "%253Cscript%253E"; // '%253Cscript%253E'
    string public constant END_SCRIPT = "%253C%252Fscript%253E"; // </script>
    string public constant BEGIN_SCRIPT_DATA = "%253Cscript%2520src%253D%2527"; // <script src='
    string public constant END_SCRIPT_DATA = "%2527%253E%253C%252Fscript%253E"; // '></script>
    string public constant BEGIN_SCRIPT_DATA_COMPRESSED =
        "%253Cscript%253Evar%2520data%2520%253D%2520base64ToBytes%2528%2527"; // <script>var data = base64ToBytes('
    string public constant END_SCRIPT_DATA_COMPRESSED =
        "%2527%2529%253B%2520var%2520unzipped%2520%253D%2520fflate.gunzipSync%2528data%2529%253B%2520var%2520text%2520%253D%2520fflate.strFromU8%2528unzipped%2529%253B%2520var%2520b64%2520%253D%2520btoa%2528text%2529%253B%2520var%2520script%2520%253D%2520document.createElement%2528%2527script%2527%2529%253B%2520script.setAttribute%2528%2527src%2527%252C%2527data%253Atext%252Fjavascript%253Bbase64%252C%2527%2520%252B%2520b64%2529%253B%2520document.head.appendChild%2528script%2529%253B%253C%252Fscript%253E"; // '); var unzipped = fflate.gunzipSync(data); var text = fflate.strFromU8(unzipped); var b64 = btoa(text); var script = document.createElement('script'); script.setAttribute('src','data:text/javascript;base64,' + b64); document.head.appendChild(script);</script>

    function HTML_HEAD() public view returns (string memory) {
        return
            string(
                abi.encodePacked(
                    "data%3Atext%2Fhtml%2C", // data:text/html,
                    BEGIN_SCRIPT_DATA,
                    base64Utils,
                    END_SCRIPT_DATA,
                    BEGIN_SCRIPT_DATA,
                    fflate(),
                    END_SCRIPT_DATA
                )
            );
    }

    function SCRIPT_VAR(
        string memory name,
        string memory value,
        bool omitQuotes
    ) public pure returns (string memory) {
        if (omitQuotes) {
            // var tokenId=1
            return
                string(
                    abi.encodePacked(
                        "var%2520",
                        name,
                        "%253D",
                        value,
                        "%253B" // space, equal, semicolon
                    )
                );
        }
        // var "tokenId=1"
        return
            string(
                abi.encodePacked(
                    "var%2520%2522",
                    name,
                    "%253D",
                    value,
                    "%2522%253B" // space, quote, equal, quote, semicolon
                )
            );
    }

    function BEGIN_METADATA_VAR(string memory name, bool omitQuotes) public pure returns (string memory) {
        if (omitQuotes) {
            return string(abi.encodePacked("%22", name, "%22%3A"));
        }

        return string(abi.encodePacked("%22", name, "%22%3A%22"));
    }

    function END_METADATA_VAR(bool omitQuotes) public pure returns (string memory) {
        if (omitQuotes) {
            return "%2C";
        }

        return "%22%2C";
    }

    address[2] private fflateAddresses;

    constructor() {
        owner = msg.sender;
    }

    function setFFlateAddress(address chunk1, address chunk2) public {
        require(msg.sender == owner);
        fflateAddresses[0] = chunk1;
        fflateAddresses[1] = chunk2;
    }

    function fflate() public view returns (string memory) {
        return compile2(fflateAddresses[0], fflateAddresses[1]);
    }

    function compile2(address chunk1, address chunk2) public view returns (string memory) {
        IDataChunk data1 = IDataChunk(chunk1);
        IDataChunk data2 = IDataChunk(chunk2);
        return string(abi.encodePacked(data1.data(), data2.data()));
    }

    function compile3(
        address chunk1,
        address chunk2,
        address chunk3
    ) public view returns (string memory) {
        IDataChunk data1 = IDataChunk(chunk1);
        IDataChunk data2 = IDataChunk(chunk2);
        IDataChunk data3 = IDataChunk(chunk3);
        return string(abi.encodePacked(data1.data(), data2.data(), data3.data()));
    }

    function compile4(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4
    ) public view returns (string memory) {
        IDataChunk data1 = IDataChunk(chunk1);
        IDataChunk data2 = IDataChunk(chunk2);
        IDataChunk data3 = IDataChunk(chunk3);
        IDataChunk data4 = IDataChunk(chunk4);
        return string(abi.encodePacked(data1.data(), data2.data(), data3.data(), data4.data()));
    }

    function compile5(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5
    ) public view returns (string memory) {
        IDataChunk data1 = IDataChunk(chunk1);
        IDataChunk data2 = IDataChunk(chunk2);
        IDataChunk data3 = IDataChunk(chunk3);
        IDataChunk data4 = IDataChunk(chunk4);
        IDataChunk data5 = IDataChunk(chunk5);
        return string(abi.encodePacked(data1.data(), data2.data(), data3.data(), data4.data(), data5.data()));
    }

    function compile6(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5,
        address chunk6
    ) public view returns (string memory) {
        IDataChunk data1 = IDataChunk(chunk1);
        IDataChunk data2 = IDataChunk(chunk2);
        IDataChunk data3 = IDataChunk(chunk3);
        IDataChunk data4 = IDataChunk(chunk4);
        IDataChunk data5 = IDataChunk(chunk5);
        IDataChunk data6 = IDataChunk(chunk6);
        return
            string(
                abi.encodePacked(data1.data(), data2.data(), data3.data(), data4.data(), data5.data(), data6.data())
            );
    }

    function compile7(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5,
        address chunk6,
        address chunk7
    ) public view returns (string memory) {
        IDataChunk data1 = IDataChunk(chunk1);
        IDataChunk data2 = IDataChunk(chunk2);
        IDataChunk data3 = IDataChunk(chunk3);
        IDataChunk data4 = IDataChunk(chunk4);
        IDataChunk data5 = IDataChunk(chunk5);
        IDataChunk data6 = IDataChunk(chunk6);
        IDataChunk data7 = IDataChunk(chunk7);
        return
            string(
                abi.encodePacked(
                    data1.data(),
                    data2.data(),
                    data3.data(),
                    data4.data(),
                    data5.data(),
                    data6.data(),
                    data7.data()
                )
            );
    }

    function compile8(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5,
        address chunk6,
        address chunk7,
        address chunk8
    ) public view returns (string memory) {
        IDataChunk data1 = IDataChunk(chunk1);
        IDataChunk data2 = IDataChunk(chunk2);
        IDataChunk data3 = IDataChunk(chunk3);
        IDataChunk data4 = IDataChunk(chunk4);
        IDataChunk data5 = IDataChunk(chunk5);
        IDataChunk data6 = IDataChunk(chunk6);
        IDataChunk data7 = IDataChunk(chunk7);
        IDataChunk data8 = IDataChunk(chunk8);
        return
            string(
                abi.encodePacked(
                    data1.data(),
                    data2.data(),
                    data3.data(),
                    data4.data(),
                    data5.data(),
                    data6.data(),
                    data7.data(),
                    data8.data()
                )
            );
    }

    function compile9(
        address chunk1,
        address chunk2,
        address chunk3,
        address chunk4,
        address chunk5,
        address chunk6,
        address chunk7,
        address chunk8,
        address chunk9
    ) public view returns (string memory) {
        IDataChunk data1 = IDataChunk(chunk1);
        IDataChunk data2 = IDataChunk(chunk2);
        IDataChunk data3 = IDataChunk(chunk3);
        IDataChunk data4 = IDataChunk(chunk4);
        IDataChunk data5 = IDataChunk(chunk5);
        IDataChunk data6 = IDataChunk(chunk6);
        IDataChunk data7 = IDataChunk(chunk7);
        IDataChunk data8 = IDataChunk(chunk8);
        IDataChunk data9 = IDataChunk(chunk9);
        return
            string(
                abi.encodePacked(
                    data1.data(),
                    data2.data(),
                    data3.data(),
                    data4.data(),
                    data5.data(),
                    data6.data(),
                    data7.data(),
                    data8.data(),
                    data9.data()
                )
            );
    }
}
